// src/UserProfile.tsx
import React from 'react';
import { Link } from 'react-router-dom';
import Slider from 'react-slick';
import styles from './css/UserProfile.module.css';
import Navbar from './NavBar';
import HomeLanding from './HomeLanding';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

// Importing images
import image1 from './css/img/store_1.jpg';
import image2 from './css/img/store_2.jpg';
import image3 from './css/img/store_3.jpg';

const UserProfile: React.FC = () => {
  const handleProfileClick = () => {
    <HomeLanding />;
  };

  const sliderSettings = {
    dots: true,
    infinite: false,
    speed: 500,
    slidesToShow: 3,  // Show 3 images at a time
    slidesToScroll: 1,
    nextArrow: <div style={{fontSize: '30px', lineHeight: '1.5'}}>›</div>,
    prevArrow: <div style={{fontSize: '30px', lineHeight: '1.5'}}>‹</div>
  };

  const images = [
    {
      src: image1,
      description: 'Description for Store Image 1'
    },
    {
      src: image2,
      description: 'Description for Store Image 2'
    },
    {
      src: image3,
      description: 'Description for Store Image 3'
    }
  ];

  return (
    <div className={styles.container}>
      <Navbar />
      <div className={styles.column}>
        <div className={styles.link} onClick={handleProfileClick}>
          <div className={styles.item}>Profile</div>
        </div>
      </div>
      <div className={styles.column}>
        <Link to="/orders" className={styles.link}>
          <div className={styles.item}>Orders</div>
        </Link>
      </div>
      <div className={styles.column}>
        <Link to="/favorites" className={styles.link}>
          <div className={styles.item}>Favorites</div>
        </Link>
      </div>
      <div className={styles.column}>
        <Link to="/messages" className={styles.link}>
          <div className={styles.item}>Messages</div>
        </Link>
      </div>
      <div className={styles.column}>
        <Link to="/waiting-lists" className={styles.link}>
          <div className={styles.item}>Waiting lists</div>
        </Link>
      </div>
      <div className={styles.column}>
        <Link to="/settings" className={styles.link}>
          <div className={styles.item}>Settings</div>
        </Link>
      </div>
      <div className={styles.sliderContainer}>
        <Slider {...sliderSettings}>
          {images.map((image, index) => (
            <div key={index} className={styles.slide}>
              <img src={image.src} alt={`Slide ${index}`} className={styles.sliderImage} />
              <p className={styles.description}>{image.description}</p>
            </div>
          ))}
        </Slider>
      </div>
    </div>
  );
};

export default UserProfile;
